import React, { Component } from "react";
import { FacebookProvider, Page, Feed } from "react-facebook";

const SocialFeedFB = () => {
	return (
		<FacebookProvider appId="855434338435342">
			<Page href="https://www.facebook.com" tabs="timeline" />
        <Feed link="https://www.facebook.com">
          {({ handleClick }) => (
            <button type="button" onClick={handleClick}>Share on Feed</button>
          )}
        </Feed>
      </FacebookProvider>   
	);
};

export default SocialFeedFB;
